DROP TABLE IF EXISTS `pipeline_node_template`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `pipeline_node_template` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `uuid` varchar(32) DEFAULT NULL COMMENT '唯一标示做关联',
  `parent_uuid` varchar(32) DEFAULT NULL COMMENT '唯一标示做关联',
  `name` varchar(100) DEFAULT NULL,
  `label` varchar(32) DEFAULT NULL COMMENT '标签',
  `nod_description` varchar(1000) DEFAULT NULL COMMENT '描述',
  `icon` varchar(32) DEFAULT NULL COMMENT '图标',
  `view` tinyint(1) DEFAULT '0' COMMENT '是否有执行结果数据',
  `type` int(11) DEFAULT NULL COMMENT '节点类型：目录 or 节点',
  `creator` varchar(64) DEFAULT NULL COMMENT '创建人',
  `modifier` varchar(64) DEFAULT NULL COMMENT '修改人',
  `gmt_create` datetime NOT NULL COMMENT '创建时间',
  `gmt_modified` datetime NOT NULL COMMENT '修改时间',
  `deleted` char(1) NOT NULL DEFAULT '0' COMMENT '逻辑删除',
  PRIMARY KEY (`id`),
  UNIQUE KEY `application_pipeline_node_name_uindex` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=89 DEFAULT CHARSET=utf8mb4 COMMENT='流水线节点类型';
